--/
CREATE DEFINER=`frontend`@`%` PROCEDURE add_device(IN i_user_email VARCHAR(256), IN i_device_type VARCHAR(50), IN i_device_id VARCHAR(50))
    COMMENT 'Revision: 140423'
BEGIN
    DECLARE v_inserted, v_uid INT DEFAULT 0;
    DECLARE v_is_active INT DEFAULT TRUE;
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
        BEGIN
            SELECT 0 as 'inserted';
        END;

    SELECT u1.id, u2.active FROM auth_user u1 JOIN ui_user u2
        ON u1.id=u2.user_ptr_id AND u1.email=i_user_email
        ORDER BY u1.id DESC
        LIMIT 1
        INTO v_uid, v_is_active;

    IF v_uid is NOT NULL THEN
            VALUES (v_uid, i_device_type, i_device_id, !v_is_active, NOW())
            ON DUPLICATE KEY UPDATE delete_status=0, date_added=VALUES(date_added);
        SET v_inserted = ROW_COUNT();
    END IF;

    SELECT v_inserted;
END
/
DROP PROCEDURE add_quri;
--/
CREATE DEFINER=`frontend`@`%` PROCEDURE add_quri(IN i_app_meta_name VARCHAR(50), IN i_uri VARCHAR(200))
    COMMENT 'Revision: 140305'
BEGIN
    DECLARE v_pos INT DEFAULT -1;
    DECLARE v_uri VARCHAR(200);
    
    SELECT TRIM(i_uri) INTO v_uri;
    IF LENGTH(v_uri) = 0 THEN
        SELECT 'Invalid uri' AS Status;
    ELSE
        SELECT LOCATE(v_uri, qualified_uris) FROM ui_appmeta WHERE name=i_app_meta_name INTO v_pos;
        IF v_pos = 0 THEN
            UPDATE ui_appmeta SET qualified_uris=CONCAT(qualified_uris, ',', v_uri) WHERE name=i_app_meta_name;
            IF ROW_COUNT() = 1 THEN
                SELECT CONCAT('Added. URIs are: ', qualified_uris) AS 'Status' FROM ui_appmeta WHERE name=i_app_meta_name;
            ELSE
                SELECT 'Failed to add URI' AS 'Status';
            END IF;
        ELSEIF v_pos > 0 THEN
            SELECT CONCAT(v_uri, ' already exists') AS 'Status';
        ELSE
            SELECT 'Invalid arguments' AS 'Status';
        END IF;
    END IF;
END
