DROP PROCEDURE get_access_policies;
--/
CREATE DEFINER=`frontend`@`%` PROCEDURE get_access_policies(IN i_email VARCHAR(256))
    COMMENT 'API Rev: 140528.01, Policy Rev: 3'
BEGIN
    DECLARE v_api_ver VARCHAR(10) DEFAULT '140528.01';
    DECLARE v_policy_ver VARCHAR(10) DEFAULT '3';

    SELECT
        'policy',
        v_api_ver,
        CONCAT('{"version":', v_policy_ver, ',', GROUP_CONCAT(t.policies SEPARATOR ','), '}')
    FROM
    (SELECT
        1 AS id,
         CONCAT(
            '"', am.id, '":',
            '[', GROUP_CONCAT(ap.compiled ORDER BY ap.ordering ASC SEPARATOR ','), ']'
        ) AS policies
    FROM auth_user u JOIN auth_user_groups ug ON u.id=ug.user_id
        JOIN auth_group g ON g.id=ug.group_id
        JOIN ui_apppolicy_groups pg ON pg.group_id=g.id
        JOIN ui_apppolicy ap ON ap.id=pg.apppolicy_id
        JOIN ui_appconfig ac ON ac.id=ap.appConfig_id
        JOIN ui_appmeta am ON am.id=ac.appMeta_id
    WHERE u.email=i_email
    GROUP BY am.id) AS t
    GROUP BY t.id;
END
/
DROP PROCEDURE get_appmeta;
--/
CREATE DEFINER=`frontend`@`%` PROCEDURE get_appmeta(IN i_in_dfa INT)
    COMMENT 'Revision: 140305'
BEGIN
    DECLARE v_num_appmeta INT DEFAULT 0;
    
    IF i_in_dfa IS NULL THEN
        SELECT COUNT(*)
        FROM ui_appmeta
        WHERE app_type IN (1, 4) AND is_installation_enabled = 1
        INTO v_num_appmeta;
        
        (SELECT
            100,
            v_num_appmeta,
            NULL,
            NULL)
        
        UNION

        (SELECT
            200,
            meta.id,
            (IFNULL(meta.dataplane_tags, '') REGEXP '[[:<:]]exchange[[:>:]]') << 0 AS 'flags',
            LOWER(meta.qualified_uris)
        FROM ui_appmeta meta
        WHERE app_type IN (1, 4) AND meta.is_installation_enabled = 1
        ORDER BY 2 ASC)

        UNION

        (SELECT
            300,
            app.company_id,
            NULL,
            GROUP_CONCAT(meta.id) AS 'meta'
        FROM ui_appconfig app INNER JOIN ui_appmeta meta ON app.appMeta_id = meta.id
        WHERE meta.is_installation_enabled = 1
        GROUP BY 2
        ORDER BY 2 ASC);
    ELSE
        SELECT COUNT(*)
        FROM ui_appmeta
        WHERE in_dfa = i_in_dfa AND app_type IN (1, 4) AND is_installation_enabled = 1
        INTO v_num_appmeta;
        
        (SELECT
            100,
            v_num_appmeta,
            NULL,
            NULL)
        
        UNION

        (SELECT
            200,
            meta.id,
            (IFNULL(meta.dataplane_tags, '') REGEXP '[[:<:]]exchange[[:>:]]') << 0 AS 'flags',
            LOWER(meta.qualified_uris)
        FROM ui_appmeta meta
        WHERE in_dfa = i_in_dfa AND app_type IN (1, 4) AND meta.is_installation_enabled = 1
        ORDER BY 2 ASC)

        UNION

        (SELECT
            300,
            app.company_id,
            NULL,
            GROUP_CONCAT(meta.id) AS 'meta'
        FROM ui_appconfig app INNER JOIN ui_appmeta meta ON app.appMeta_id = meta.id
        WHERE meta.in_dfa = i_in_dfa AND meta.app_type IN (1, 4) AND meta.is_installation_enabled = 1
        GROUP BY 2
        ORDER BY 2 ASC);
    END IF;
END
/
