CREATE DEFINER=`frontend`@`%` PROCEDURE lookup_user_email(IN i_ad_username VARCHAR(256),
                                     IN i_real_host VARCHAR(256))
    COMMENT 'Revision: 140326'
BEGIN
    SELECT DISTINCT f.email FROM ui_appdomainconfig a
        JOIN ui_appconfig b ON a.appConfig_id=b.id
        JOIN ui_group c ON b.company_id=c.company_id
        JOIN ui_membership d ON c.group_ptr_id=d.group_id
        JOIN ui_user e ON d.user_id=e.user_ptr_id
        JOIN auth_user f ON e.user_ptr_id=f.id
        WHERE a.mail_server_url=i_real_host and e.ad_user_name=i_ad_username;
END
