DROP PROCEDURE update_adusernames;
--/
CREATE DEFINER=`frontend`@`%` PROCEDURE update_adusernames(IN i_app_domain_config_id INT)
    COMMENT 'Revision: 140305'
BEGIN
    DECLARE v_login_format INT DEFAULT 0;
    DECLARE v_domain, v_netbios VARCHAR(200);
    DECLARE done INT DEFAULT 0;
    
    DECLARE c_domains CURSOR FOR
        SELECT CONCAT('%@', d.name), dc.netbios_name, dc.mail_server_login_format
        FROM ui_domain d JOIN ui_appdomainconfig dc ON d.id = dc.domain_id
        WHERE dc.id = i_app_domain_config_id;
        
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;
    
    OPEN c_domains;
    REPEAT
        FETCH c_domains INTO v_domain, v_netbios, v_login_format;
        
        IF NOT done THEN
            SELECT v_domain, v_netbios, v_login_format;
        
            IF v_login_format = 1 THEN              
                UPDATE IGNORE ui_user uu, auth_user au
                SET uu.ad_user_name = au.email
                WHERE uu.user_ptr_id = au.id AND au.email LIKE v_domain;
            
            ELSEIF v_login_format = 2 THEN          
                UPDATE IGNORE ui_user uu, auth_user au
                SET uu.ad_user_name = CONCAT(v_netbios, '\\', uu.samaccountname)
                WHERE uu.user_ptr_id = au.id AND au.email LIKE v_domain;
            
            ELSEIF v_login_format = 3 THEN          
                UPDATE IGNORE ui_user uu, auth_user au
                SET uu.ad_user_name = uu.upn
                WHERE uu.user_ptr_id = au.id AND au.email LIKE v_domain;
        
            ELSEIF v_login_format = 4 THEN          
                UPDATE IGNORE ui_user uu, auth_user au
                SET uu.ad_user_name = uu.samaccountname
                WHERE uu.user_ptr_id = au.id AND au.email LIKE v_domain;
                
            END IF;

            SELECT CONCAT('Updated ', ROW_COUNT(), ' users in ', v_domain) AS 'Status';
        END IF;
        
    UNTIL done END REPEAT;
    CLOSE c_domains;
END
/
DROP PROCEDURE update_device;
--/
CREATE DEFINER=`frontend`@`%` PROCEDURE update_device(IN i_user_email VARCHAR(256),
                                 IN i_device_id VARCHAR(50),
                                 IN i_device_policy_seq VARCHAR(50))
    COMMENT 'Revision: 140212'
BEGIN
    DECLARE current_device_policy_seq, updated INT DEFAULT 0;
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
        BEGIN
            SELECT 0 as 'updated';
        END;

    SELECT d.device_policy_seq
        FROM ui_device d, auth_user u
        WHERE d.device_id = i_device_id AND d.user_id = u.id AND u.email = i_user_email
        INTO current_device_policy_seq;
        
    IF current_device_policy_seq = i_device_policy_seq THEN
        SET updated = 2;
    ELSE
        UPDATE ui_device d, auth_user u
            SET d.device_policy_seq = i_device_policy_seq
            WHERE d.device_id = i_device_id AND d.user_id = u.id AND u.email = i_user_email;
        SET updated = ROW_COUNT();
    END IF;
    SELECT updated;
END
/
