BEGIN
    DECLARE v_user_id, v_active, v_company_id, v_as_password_state INT;
    DECLARE v_use_local_password_for_activesync INT;
    DECLARE v_ad_user_name VARCHAR(50);

    SELECT DISTINCT u.id, ui_user.active, ui_user.ad_user_name, c.id, ui_user.as_password_state,
