    FROM auth_user u
        JOIN ui_user ON u.id=ui_user.user_ptr_id
        LEFT JOIN ui_membership m ON u.id=m.user_id
        LEFT JOIN ui_group g ON m.group_id=g.group_ptr_id
        LEFT JOIN ui_company c ON g.company_id=c.id
    WHERE u.email=i_email
    ORDER BY u.id DESC
    LIMIT 1
    INTO v_user_id, v_active, v_ad_user_name, v_company_id, v_as_password_state,
         v_use_local_password_for_activesync;

    
    
    
    
    
    
    
    
    SELECT 1,
           NULL,
           NULL,
           NULL,
           v_user_id,
           v_company_id,
           v_active,
           v_ad_user_name,
           v_as_password_state,
           v_use_local_password_for_activesync           
    UNION
    SELECT 2,
           p.id,
           up.setting,
           p.name,
           NULL,
           NULL,
           NULL,
           NULL,
           NULL,
           NULL
        FROM ui_policy p JOIN ui_userpolicy up ON p.id=up.policy_id
        WHERE up.user_id=v_user_id
    UNION
    SELECT 2,
           p.id,
           REPLACE(CONCAT('[', GROUP_CONCAT(cp.setting), ']'), '''', '"'),
           p.name,
           NULL,
           NULL,
           NULL,
           NULL,
           NULL,
           NULL
        FROM ui_policy p JOIN ui_companypolicy cp ON p.id=cp.policy_id
        WHERE cp.company_id=v_company_id
        GROUP BY p.id
    UNION    
    SELECT 2,
           1000, 
           CONCAT('[', GROUP_CONCAT(a.id), ']'),
           NULL,
           NULL,
           NULL,
           NULL,
           NULL,
           NULL,
           NULL
        FROM ui_membership m
        JOIN ui_group g ON m.group_id=g.group_ptr_id AND m.user_id=v_user_id
        JOIN ui_application_groups ag ON g.group_ptr_id=ag.group_id
        JOIN ui_application a ON ag.application_id=a.id
    UNION
    SELECT 3,
           device_id,
           wipe,
           NULL,
           NULL,
           NULL,
           NULL,
           NULL,
           NULL,
           NULL
        FROM ui_device
        where user_id=v_user_id
    ORDER BY 1 ASC;
    
END
