CREATE DEFINER=`frontend`@`%` PROCEDURE user_policies_140108(IN i_email VARCHAR(256))
    COMMENT 'Revision: 140514'
BEGIN
    DECLARE v_user_id, v_active, v_company_id, v_as_password_state, v_device_policy_seq INT;
    DECLARE v_use_local_password_for_activesync, v_migration_status INT;
    DECLARE v_ad_user_name, v_as_device_type, v_first_name, v_last_name VARCHAR(50) CHARACTER SET utf8;
    DECLARE v_mail_server_url VARCHAR(200) CHARACTER SET utf8;

    SELECT DISTINCT u.id, (ui_user.active AND c.status IN (2,5)), ui_user.ad_user_name, c.id, ui_user.as_password_state,
        u.first_name, u.last_name, ui_user.migration_status
    FROM auth_user u
        JOIN ui_user ON u.id=ui_user.user_ptr_id
        LEFT JOIN ui_membership m ON u.id=m.user_id
        LEFT JOIN ui_group g ON m.group_id=g.group_ptr_id
        LEFT JOIN ui_company c ON g.company_id=c.id
    WHERE u.email=i_email
    ORDER BY u.id DESC
    LIMIT 1
    INTO v_user_id, v_active, v_ad_user_name, v_company_id, v_as_password_state,
         v_first_name, v_last_name, v_migration_status;

    

    SELECT adc.use_local_password_for_activesync, adc.as_device_type, adc.mail_server_url
    FROM ui_domain d JOIN ui_appdomainconfig adc ON d.id=adc.domain_id
    WHERE adc.is_hosting_mail_enabled=TRUE AND d.name=SUBSTRING_INDEX(i_email, '@', -1)
    LIMIT 1 
    INTO v_use_local_password_for_activesync, v_as_device_type, v_mail_server_url;

    
    
    
    
    
    
    
    
    (SELECT 1,
           NULL,
           NULL,
           NULL,
           v_user_id,
           v_company_id,
           v_active,
           v_ad_user_name,
           v_as_password_state,
           v_use_local_password_for_activesync,
           v_first_name,
           v_last_name,
           v_as_device_type,
           v_migration_status,
           v_mail_server_url)
    UNION
    (SELECT 2,
           s.id,
           cs.value,
           s.name,
           NULL,
           NULL,
           NULL,
           NULL,
           NULL,
           NULL,
           NULL,
           NULL,
           NULL,
           NULL,
           NULL
        FROM ui_companysetting cs JOIN ui_setting s ON cs.setting_id=s.id
        WHERE cs.company_id=v_company_id)
    
    UNION
    (SELECT 3,
           device_id,
           IFNULL(selective_wipe_status|full_wipe_status<<2, 0),
           device_policy_seq,
           NULL,
           NULL,
           NULL,
           NULL,
           NULL,
           NULL,
           NULL,
           NULL,
           NULL,
           NULL,
           NULL
        FROM ui_device
        WHERE user_id=v_user_id AND delete_status <> 3
        ORDER BY 2 ASC)
    ORDER BY 1 ASC;

END
